import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
    StyleSheet,
    Text,
    View, SafeAreaView,
    TouchableOpacity,
    TextInput,
} from 'react-native';




function Login()
{
    const navigate = useNavigate();
    const [txtError, setTextError] = useState('');

    const [email, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const navigateHome = () => 
    {
        navigate('/home');
    }

    const doLogin = async event => 
    {
        event.preventDefault();

        alert('Logging in!!');
        navigateHome();
    };

const signUp = () => 
{
    navigate('/signUp');
}
const handleApi = async () => {
    try{
    

    
        console.log(email, password);
        /*axios.post('https://gainzboy.herokuapp.com/auth/login' ,{
        email : email ,
        password : password
        } )
        .then(response => {    
            console.log(response.data)
        alert('Success')
        } )
        .catch(error => {
        alert('service error')
        console.log(error);
        } );*/
        var item = { email : email.trim() , password : password.trim()};

        var js = JSON.stringify(item);

        const result = await fetch ("https://gainzboy.herokuapp.com/auth/login" , {
            method : 'POST',
            body : js ,
            headers : {
                "Content-Type" : "application/json" }     
        });
        var res = JSON.parse(await result.text());
        if (res.errorMessage != undefined) {
            setTextError(res.errorMessage);
        }
        else {
            global.userId = res.userID;
            global.token = res.token;
            global.fullName = res.fullname;
            global.email = email.trim();
            global.password = password.trim();

        }

    }catch(e){
        setTextError(e.message);
    }
}
const errorRender = () => {
    if (txtError != '')
        return (<View style={{ justifyContent: 'center', alignItems: 'center' }}>
            <Text style={styles.txtError}>{txtError}</Text>
        </View>);
    else
        return (<View />);
}
    return(
      <div class="box">
        <div id="loginDiv" class ="BoxContainer">
            <form class ="FormContainer">
            <span id="inner-title"><h1>GAINZ<span class="textLogo">BOY</span></h1></span><br />
            <input type="text" id="loginName" placeholder="email" 
            onChange={(e)=>setUsername(e.target.value)}
            /><br />
            <input type="password" id="loginPassword" placeholder="password" 
            onChange={(e)=>setPassword(e.target.value)}/><br />
            </form>
            <button onClick={handleApi} className="loginButton"> Login</button>
           
            <button onClick={signUp} className="loginButton"> Sign Up</button>
        </div>
    </div>  
      
    );
};
const styles = StyleSheet.create({
    spaceContainer: {
        height: 50
    },
    indentContainer: {
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'center',
        height: 90,
        width: 220,
        backgroundColor: colors.blackLite,
        borderRadius: 100,
        transform: [{ rotate: "-50deg" }],
    },
    txtSingleFactorInfo: {
        height: 65,
        width: 300,
        paddingLeft: 25,
        paddingRight: 25,
        paddingBottom: 8,
        borderTopLeftRadius: 10,
        borderTopRightRadius: 10,
        borderBottomLeftRadius: 10,
        borderBottomRightRadius: 50,
        fontSize: 25,
        backgroundColor: colors.white,
        color: colors.black,
        shadowColor: 'black',
        shadowRadius: 3,
        shadowOffset: { width: 3, height: 10, },
        shadowOpacity: 0.5,
    },
    btn: {
        height: 60,
        width: 60,
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 100,
        backgroundColor: colors.CJpurple,
        shadowColor: 'black',
        shadowRadius: 3,
        shadowOffset: { width: 3, height: 5, },
        shadowOpacity: 0.5,
    },
    txtForgotPassword: {
        fontSize: 20,
        color: colors.green
    },
    txtLogin: {
        fontSize: 25,
        color: colors.green,
        transform: [{ rotate: "50deg" }],
    },
    txtSignUp: {
        fontSize: 18,
        color: colors.green,
        transform: [{ rotate: "50deg" }],
    },
    txtError: {
        fontSize: 20,
        color: colors.red
    }
});
export default Login;
